慶元宮，創建於1888（光緒14）年10月，日治時期位址在羅東郡五結庄頂清水字社尾46番地，今址則是五結鄉新店路11號；以香山祖師為主神，同祀有福德正神。基地面積50坪，建築面積5.8坪；祭祀圈包含社尾全部，例祭日為每年農曆5月26日（香山祖師聖誕）。其廟體建築為單開間，立於疊石台基之上，兩側牆體以土埆砌築並表面粉刷，正面採出屐起，以紅磚與木作構成，與側牆鄰接處可見木作挑簷斗栱，屋頂鋪以茅草。 　　根據五結庄役場1936（昭和11）年出版的《寺廟臺帳》，當時五結庄共有38處宗教建築，有37處是台灣傳統廟宇，1處日本神社（二結稻荷社）。其中，在利澤簡八大庄範圍內，則有14處台灣傳統廟宇。大多數廟宇今仍存，但規模、型態均與《寺廟臺帳》所呈現的樣貌不同。

